import React from 'react';
import LoginPage from './components/Login/LoginPage';
import Footer from './components/Footer/Footer'; // Import the Footer component
import Header from './components/Header/Header';

function App() {
  return (
    <div className="App">
      <LoginPage />
      <Footer /> 
      <Header/>
    </div>
  );
}

export default App;
